import React from 'react'
import {Row, Col } from 'react-bootstrap'
import {Cont1} from './component_home/Cont1'
import {Cont2} from './component_home/Cont2'
import {Cont3} from './component_home/Cont3'

export const Home = ({params}) => {
    //console.log(params);
    return (
        <div className="homeContent">
            {
                (params.sizeScreen === "isBigDesktop" || params.sizeScreen === "isDesktop" || params.sizeScreen === "isDafault")
                && <Row className={params.sizeScreen+" g-0"}>
                        <Col md={8}>
                            <Cont1 params={params}/>
                        </Col>
                        <Col md={4}>
                            <Cont2 params={params}/>
                            <Cont3 params={params}/>
                        </Col>
                    </Row>
            }

            {
                (params.sizeScreen === "isSmallDesktop")
                && <Row className={params.sizeScreen+" g-0"}>
                        <Col md={7}>
                            <Cont1 params={params}/>
                        </Col>
                        <Col md={5}>
                            <Cont2 params={params}/>
                            <Cont3 params={params}/>
                        </Col>
                    </Row>
            }

            {
                (params.sizeScreen === "isTablet")
                && <Row className={params.sizeScreen+" g-0"}>
                        <Col md={12}>
                            <Cont1 params={params}/>
                        </Col>
                        <Col md={12}>
                            <Cont2 params={params}/>
                            <Cont3 params={params}/>
                        </Col>
                    </Row>
            }

            {
                (params.sizeScreen === "isMobile")
                && <Row className={params.sizeScreen+" g-0"}>
                        <Col md={12}>
                            <Cont1 params={params}/>
                        </Col>
                        <Col md={12}>
                            <Cont2 params={params}/>
                            <Cont3 params={params}/>
                        </Col>
                    </Row>
            }

        </div>
    )
}


